export default props =>
  <div className='App'>
    <div className='App-header'>
      <label htmlFor='single'>
        <input type='file' id='single' onChange={props.onChange}>
          <img src={logo} className="App-logo" alt="logo" />
        </input>
      </label>

    </div>
  </div>


